import React, { Component } from 'react';
import axios from 'a'
class Home extends Component {
    constructor(props){
        super(props);
        this.state = {
            values: []
        }
    }
    componentDidMount() {
        fetch(
            'http://localhost:5000/api/values'
        )
            //.then(res => res.json())
            .then(data => {
                this.setState({ values: data });
            })
            .catch(err => console.log(err));
    }
    render() {
        return (
            <div>
                <h1>Home Component</h1>
            </div>
        );
    }
}

export default Home;
